import React, { useState } from "react";
import FormUser from "./FormUser";
import "./FormAppend.css";

const FormAppend = (props) => {
  let content = <p style={{textAlign: center}}>Add A User</p>;

  if (props.user_data.length > 0) {
    content = <FormUser userData={props.user_data} />;
  }

  return (
    <div className="display-user">
      {content}
      {/* <FormUser userData={props.user_data} /> */}
    </div>
  );
};

export default FormAppend;
